// src/components/FlightSearch.tsx
import React, { useState } from "react";

interface SearchParams {
  from: string;
  to: string;
  departDate: string;
  returnDate?: string;
  passengers: number;
}

interface Props {
  onSearch: (params: SearchParams) => void;
}

const FlightSearch: React.FC<Props> = ({ onSearch }) => {
  const [formData, setFormData] = useState<SearchParams>({
    from: "",
    to: "",
    departDate: "",
    returnDate: "",
    passengers: 1,
  });

  const [errors, setErrors] = useState<{ [key: string]: string }>({});

  const validate = () => {
    const newErrors: { [key: string]: string } = {};
    if (!formData.from.trim()) newErrors.from = "Introduceți orașul de plecare";
    if (!formData.to.trim()) newErrors.to = "Introduceți destinația";
    if (!formData.departDate) newErrors.departDate = "Selectați data plecării";
    if (
      formData.returnDate &&
      formData.returnDate < formData.departDate
    )
      newErrors.returnDate = "Data întoarcerii nu poate fi mai devreme decât data plecării";
    if (formData.passengers < 1)
      newErrors.passengers = "Trebuie să existe cel puțin un pasager";

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleChange = (
    e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>
  ) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: name === "passengers" ? parseInt(value) : value,
    }));
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    if (validate()) {
      onSearch(formData);
    }
  };

  return (
    <form
      onSubmit={handleSubmit}
      noValidate
      className="grid grid-cols-1 md:grid-cols-2 gap-6"
    >
      {/* From */}
      <div>
        <label
          htmlFor="from"
          className="block mb-2 font-semibold text-gray-700"
        >
          De la
        </label>
        <input
          type="text"
          id="from"
          name="from"
          value={formData.from}
          onChange={handleChange}
          placeholder="Oraș de plecare"
          className={`w-full rounded-lg border px-4 py-3 focus:outline-none focus:ring-2 transition ${
            errors.from
              ? "border-red-500 focus:ring-red-400"
              : "border-gray-300 focus:ring-blue-500"
          }`}
        />
        {errors.from && (
          <p className="text-red-600 mt-1 text-sm">{errors.from}</p>
        )}
      </div>

      {/* To */}
      <div>
        <label
          htmlFor="to"
          className="block mb-2 font-semibold text-gray-700"
        >
          Către
        </label>
        <input
          type="text"
          id="to"
          name="to"
          value={formData.to}
          onChange={handleChange}
          placeholder="Destinație"
          className={`w-full rounded-lg border px-4 py-3 focus:outline-none focus:ring-2 transition ${
            errors.to
              ? "border-red-500 focus:ring-red-400"
              : "border-gray-300 focus:ring-blue-500"
          }`}
        />
        {errors.to && (
          <p className="text-red-600 mt-1 text-sm">{errors.to}</p>
        )}
      </div>

      {/* Depart Date */}
      <div>
        <label
          htmlFor="departDate"
          className="block mb-2 font-semibold text-gray-700"
        >
          Data plecării
        </label>
        <input
          type="date"
          id="departDate"
          name="departDate"
          value={formData.departDate}
          onChange={handleChange}
          className={`w-full rounded-lg border px-4 py-3 focus:outline-none focus:ring-2 transition ${
            errors.departDate
              ? "border-red-500 focus:ring-red-400"
              : "border-gray-300 focus:ring-blue-500"
          }`}
        />
        {errors.departDate && (
          <p className="text-red-600 mt-1 text-sm">{errors.departDate}</p>
        )}
      </div>

      {/* Return Date */}
      <div>
        <label
          htmlFor="returnDate"
          className="block mb-2 font-semibold text-gray-700"
        >
          Data întoarcerii (opțional)
        </label>
        <input
          type="date"
          id="returnDate"
          name="returnDate"
          value={formData.returnDate}
          onChange={handleChange}
          className={`w-full rounded-lg border px-4 py-3 focus:outline-none focus:ring-2 transition ${
            errors.returnDate
              ? "border-red-500 focus:ring-red-400"
              : "border-gray-300 focus:ring-blue-500"
          }`}
        />
        {errors.returnDate && (
          <p className="text-red-600 mt-1 text-sm">{errors.returnDate}</p>
        )}
      </div>

      {/* Passengers */}
      <div>
        <label
          htmlFor="passengers"
          className="block mb-2 font-semibold text-gray-700"
        >
          Număr pasageri
        </label>
        <select
          id="passengers"
          name="passengers"
          value={formData.passengers}
          onChange={handleChange}
          className={`w-full rounded-lg border px-4 py-3 focus:outline-none focus:ring-2 transition ${
            errors.passengers
              ? "border-red-500 focus:ring-red-400"
              : "border-gray-300 focus:ring-blue-500"
          }`}
        >
          {[...Array(10)].map((_, i) => (
            <option key={i + 1} value={i + 1}>
              {i + 1}
            </option>
          ))}
        </select>
        {errors.passengers && (
          <p className="text-red-600 mt-1 text-sm">{errors.passengers}</p>
        )}
      </div>

      {/* Submit Button */}
      <div className="md:col-span-2">
        <button
          type="submit"
          className="w-full bg-gradient-to-r from-blue-600 to-blue-700 hover:from-blue-700 hover:to-blue-800
                     text-white font-bold py-4 rounded-xl shadow-lg transition-transform active:scale-95"
        >
          Caută zboruri
        </button>
      </div>
    </form>
  );
};

export default FlightSearch;
